
var CORSAIR_COMMAND_WRITE       = 0x07;
var CORSAIR_COMMAND_READ        = 0x0E;
var CORSAIR_COMMAND_STREAM      = 0x7F;

var CORSAIR_LIGHTING_CONTROL_HARDWARE           = 0x01;
var CORSAIR_LIGHTING_CONTROL_SOFTWARE           = 0x02;

var CORSAIR_PROPERTY_SPECIAL_FUNCTION = 0x04;
var CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR         = 0x22;


export function Name() { return "Corsair Nightsword"; }
export function VendorId() { return 0x1b1c; }
export function ProductId() { return 0x1B5C; }
export function Publisher() { return "WhirlwindFX"; }
export function Size() { return [3, 4]; }
export function DefaultPosition() {return [225,120]; }
export function DefaultScale(){return 15.0}
export function ControllableParameters(){
    return [
        {"property":"shutdownColor", "label":"Shutdown Color","min":"0","max":"360","type":"color","default":"009bde"},
        {"property":"LightingMode", "label":"Lighting Mode", "type":"combobox", "values":["Canvas","Forced"], "default":"Canvas"},
        {"property":"forcedColor", "label":"Forced Color","min":"0","max":"360","type":"color","default":"009bde"},
        {"property":"DpiControl", "label":"Enable Dpi Control","type":"boolean","default":"false"},
        {"property":"dpi1", "label":"DPI", "type":"number","min":"200", "max":"12400","default":"800"},
    ];
}
var savedDpi1;

function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }
var vLedNames = ["Logo Zone","Rear Zone","Front Zone", "Scroll Zone"];

var vLedPositions = [[2,2],[2,3],[1,0],[0,0]
];

export function LedNames()
{
  return vLedNames;
}

export function LedPositions()
{
  return vLedPositions;
}

function EnableSoftwareControl()
{
    var packet = [];

    // Lighting ctrl packet.
    packet[0x00]           = 0x00;
    packet[0x01]           = CORSAIR_COMMAND_WRITE;
    packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
    packet[0x03]           = CORSAIR_LIGHTING_CONTROL_SOFTWARE;

    // Send.
    device.write(packet, 65);
}


function ReturnToHardwareControl()
{
    var packet = [];

    // Lighting ctrl packet.
    packet[0x00]           = 0x00;
    packet[0x01]           = CORSAIR_COMMAND_WRITE;
    packet[0x02]           = CORSAIR_PROPERTY_SPECIAL_FUNCTION;
    packet[0x03]           = CORSAIR_LIGHTING_CONTROL_HARDWARE;

    // Send packet.
    device.write(packet, 65);
}


export function Initialize()
{
    EnableSoftwareControl();

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }
}

function setDpi(dpi){

  savedDpi1 = dpi;
  var packet = [];
  packet[0] = 0x00;
  packet[1] = 0x07;
  packet[2] = 0x13;
  packet[3] = 0xD1;
  packet[4] = 0x00;
  packet[5] = 0x00;
  packet[6] = dpi%256;
  packet[7] = Math.floor(dpi/256);
  packet[8] = dpi%256;
  packet[9] = Math.floor(dpi/256);
  packet[10] = 0x00;
  packet[11] = 0xBF;
  packet[12] = 0xFF;
  device.write(packet, 65);

  var packet = [];
  packet[0] = 0x00;
  packet[1] = 0x07;
  packet[2] = 0x13;
  packet[3] = 0x02;
  packet[4] = 0x00;
  packet[5] = 0x01;
  device.write(packet, 65);

}

export function Render()
{       
    sendColors();

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }
}
function sendColors(shutdown = false){

    var packet = []
    packet[0x00]   = 0x00;
    packet[0x01]   = CORSAIR_COMMAND_WRITE;
    packet[0x02]   = CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR;
    packet[0x03]   = 0x04;
    packet[0x04]   = 0x01;
    var zoneId = [2,6,1,4]

    // Single zone - apply to mouse.
    for(var zone_idx = 0; zone_idx < vLedPositions.length; zone_idx++)
    {
        var iX = vLedPositions[zone_idx][0];
        var iY = vLedPositions[zone_idx][1];
        var col;
        if(shutdown){
            col = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            col = hexToRgb(forcedColor)
        }else{
            col = device.color(iX, iY);
        }        
        packet[(zone_idx * 4) + 5] = zoneId[zone_idx];
        packet[(zone_idx * 4) + 6] = col[0];
        packet[(zone_idx * 4) + 7] = col[1];
        packet[(zone_idx * 4) + 8] = col[2];
    }

    device.write(packet, 65);
}

export function Validate(endpoint)
{
    return endpoint.interface === 1;
}

export function Shutdown()
{
    var packet = []
    packet[0x00]   = 0x00;
    packet[0x01]   = CORSAIR_COMMAND_WRITE;
    packet[0x02]   = CORSAIR_PROPERTY_SUBMIT_MOUSE_COLOR;
    packet[0x03]   = 0x04;
    packet[0x04]   = 0x01;
    var zoneId = [2,6,1,4]

    // Single zone - apply to mouse.
    for(var zone_idx = 0; zone_idx < vLedPositions.length; zone_idx++)
    {
        var iX = vLedPositions[zone_idx][0];
        var iY = vLedPositions[zone_idx][1];
        var col = device.color(iX,iY);
        packet[(zone_idx * 4) + 5] = zoneId[zone_idx];
        packet[(zone_idx * 4) + 6] = 255;
        packet[(zone_idx * 4) + 7] = 0;
        packet[(zone_idx * 4) + 8] = 0;
    }

    device.write(packet, 65);

    ReturnToHardwareControl();
}

